const inf = Number.POSITIVE_INFINITY;
const Counter = class {
    constructor(iterable) {
        this.counter = new Map();
        if (iterable) {
            for (const item of iterable) {
                this.set(item, this.get(item) + 1 || 1);
            }
        }
    }
    get(item) {
        return this.counter.get(item) || 0;
    }
    set(item, count) {
        this.counter.set(item, count);
    }
    delete(item) {
        this.counter.delete(item);
    }
    keys() {
        return this.counter.keys();
    }
    values() {
        return this.counter.values();
    }
    items() {
        return this.counter.entries();
    }
    clear() {
        this.counter.clear();
    }
    size() {
        return this.counter.size;
    }
    toString() {
        return `[object Counter(${[...this.counter.entries()]})]`;
